import { NavLink, Switch, Route, BrowserRouter } from "react-router-dom";
import React, { useState } from "react";
import TextLoop from "react-text-loop";
import { Component, useEffect } from "react";
import './App.css';

function App() {
  const [starterAmount, setStarterAmount] = useState(0)
  const [prompts, setPrompts] = useState([])

  return (
    <div className="App">
      <div className="introduction-section">
        <h1> LIFE IN LITERACY </h1>
        <h3> Control your{" "} 
        <TextLoop>
            <span>spending</span>
            <span>saving</span>
            <span>present</span>
            <span className="future-txt">future</span>
        </TextLoop>
        </h3>
      </div>

      <div className="profile-section">

      </div>

    <div class="start-section">
    <ul>
      <li>
        <NavLink exact activeClassName="current" to="/play">
          START SIMULATION
        </NavLink>
      </li>
        </ul>
        <footer>
          <h8>Made by: <a href="https://github.com/michelleberry">Michelle Berry</a>, <a href="https://github.com/radwin01">Yara Radwan</a>, <a href="https://github.com/mshankar58">Maya Shankar</a>, ______</h8>
        </footer>
        </div>
        <Main />
        </div>
  );
}

const Play = () => (
<div><h2> Coming Soon </h2></div>
);

const Home = () => (
  <div className="play-page">
  </div>
);


const Main = () => (
  <BrowserRouter>
  <Switch>
    <Route exact path="/" component={Home}></Route>
    <Route exact path="/play" component={Play}></Route>
  </Switch>
  </BrowserRouter>
);

export default App;
